      SELECT DISTINCT * FROM tab1 (FORMAT parquet) WHERE NOT NULL NOT BETWEEN - - 17 - col1 AND col0 / + CAST ( - col1 AS INTEGER ) / + col1 + + - col1;
  - name: tab1

outputs:
  - name: q12425.out
    data: |
